use rcbill_my;

select * from rcbill_my.dailyactivenumber
where 
contractcode in ('I.000191958')
order by period;

select * from rcbill_my.dailyactivenumber
where 
clientcode in ('I.000011750')
-- clientcode in ('I.000015235 ')
and reported='Y'
order by period, contractcode;

select * from rcbill_my.dailyactivenumber
where 
clientcode in ('I.000011750')
-- clientcode in ('I.000015235 ')
and
period in ('2017-07-09')
and reported='Y'
order by period, contractid;


select * from rcbill_my.dailyactivenumber
where 
clientcode in ('I.000011750')
-- clientcode in ('I.000015235 ')
and PREVIOUSSERVICETYPE is not null
and reported='Y'
order by period, contractid;



select distinct period, periodday, periodmth, periodyear, contractcode, count(*), 
servicecategory, SERVICESUBCATEGORY, SERVICETYPE 
from rcbill_my.dailyactivenumber
where 
clientcode in ('I.000011750')
-- clientcode in ('I.000015235 ')
and reported='Y'
group by period, contractcode, servicecategory, SERVICESUBCATEGORY, SERVICETYPE
order by contractcode, period;

select * from rcbill_my.dailyactivenumber
where clientcode in ('I.000011750')
order by contractcode, period
;

select period, periodday, periodmth, periodyear, contractcode, 
servicecategory, SERVICESUBCATEGORY, SERVICETYPE
, activecount, DEVICESCOUNT 
from rcbill_my.dailyactivenumber
where 
clientcode in ('I.000011750')
-- clientcode in ('I.000015235 ')
and reported='Y'
order by contractcode, period
;



select distinct period, periodday, periodmth, periodyear, sum(activecount), sum(devicescount), 
count(CONTRACTCODE)
from rcbill_my.dailyactivenumber
where 
-- clientcode in ('I.000011750')
-- clientcode in ('I.000015235')
-- clientcode in ('I.000013539')
CLIENTCODE in ('I.000012247')
and reported='Y'
group by period, periodday, periodmth, periodyear
order by period, periodday, periodmth, periodyear
;


select * from rcbill_my.dailyactivenumber
where 
-- clientcode in ('I.000011750')
-- clientcode in ('I.000015235')
-- clientcode in ('I.000013539')
CLIENTCODE in ('I.000012247')
and reported='Y'
order by period, contractcode;

select contractcode, period, periodday, periodmth, periodyear
,SERVICECATEGORY,SERVICESUBCATEGORY,SERVICETYPE
from rcbill_my.dailyactivenumber
where 
-- clientcode in ('I.000011750')
-- clientcode in ('I.000015235')
 clientcode in ('I.000013539')
-- CLIENTCODE in ('I.000012247')
and reported='Y'
order by SERVICECATEGORY,contractcode, period, periodday, periodmth, periodyear
;


select distinct reported from rcbill_my.dailyactivenumber;

select * from rcbill.clientextendedreport where match(cl_clientname, CL_CLIENTCODE) AGAINST('%11750%' IN BOOLEAN MODE);

select 
cl_clientname 
, cl_clientcode
, CL_CLIENTID
, TotalContracts
, InActiveContracts
, ActiveContracts
, ActiveSubscriptions

, DevicesCount
, TotalContractsWithDevices
, firstcontractdate
, ClassName

, TotalInvoices
, TotalInvoiceAmount
, TotalPayments
, TotalPaymentAmount

, FirstInvoiceDate
, FirstPaymentDate
, LastInvoiceDate
, LastPaymentDate

, REPORTDATE
, CLIENTDEBT_REPORTDATE

, CL_NIN
, CL_PassNo
, CL_MPhone
, CL_MEMAIL
, CL_MOLADDRESS
from rcbill.clientextendedreport where cl_clientcode in ('I.000013539');


