select distinct contractcode, count(contractid)
from dailyactivenumber
where period='2017-05-31' and servicecategory='TV' and clienttype='Residential' and reported='Y'
group by contractcode
order by 2 desc, contractcode
;


SELECT contractcode, GROUP_CONCAT(servicetype SEPARATOR ', ')
FROM dailyactivenumber 
where period='2017-05-31' and servicecategory='TV' and clienttype='Residential' and reported='Y'
GROUP BY contractcode
;

select contractcode, clientcode, clientname, clientclass, clienttype, servicecategory, servicetype
from dailyactivenumber
where period='2017-05-31'
-- and servicecategory='TV' 
-- and clienttype='Residential' 
 and reported='Y'
;

select * from dailyactivenumber where CLIENTNAME like '%rahul%';

select * from dailyactivenumber where clientid in (723711);
select * from dailyactivenumber where clientcode in ('I.000011750');
select * from dailyactivenumber where contractid in (2013961);
select * from dailyactivenumber where contractcode in ('I.000189799');

select clientid, clientcode, clientname, contractid, contractcode,CONTRACTSTATE, period, servicecategory, servicetype
from dailyactivenumber
where 
clientid=723711
order by clientcode, servicecategory, contractcode, period
;

select clientid, clientcode, clientname, contractid, contractcode,CONTRACTSTATE, period, servicecategory, servicetype, PRICE
from dailyactivenumber
where 
clientcode in ('I.000009344')
order by clientcode, servicecategory, contractcode, period
;
select clientid, clientcode, clientname, contractid, contractcode,CONTRACTSTATE, period, servicecategory, servicetype, PRICE
from dailyactivenumber
where 
clientcode in ('I.000008127')
order by clientcode, servicecategory, contractcode, period
;


select * from dailyactivenumber where clientcode in ('I.000009344');

select * from dailyactivenumber where clientcode in ('I.000011750');

select * from dailyactivenumber where servicecategory in ('Internet') and period = '2017-03-20';

select * from dailyactivenumber where servicecategory in ('Internet') and period = '2017-04-11';

select period, reported, servicecategory, servicetype, sum(activecount), sum(devicescount) from dailyactivenumber where period = '2017-04-11'
group by period, reported, servicecategory, servicetype
;

select * from dailyactivenumber where period = '2017-03-27' and region in ('Interconnect');

select * from dailyactivenumber where servicetype='Crimson' and previousservicetype is not null;


-- ===========================================================

select * from dailyactivenumber where period=@rundate;

select period, contractcode, clientcode, clientname, contractstate, lastaction, servicetype, previousservicetype, clientclass
from dailyactivenumber
where 
-- period > '2017-03-24'
-- and 
servicecategory='Internet'
-- (servicetype='Crimson' or previousservicetype='Crimson') 
order by clientcode, period, clientname; 
-- ============================================================


select servicetype, period, count(contractcode) as contractcount, contractstate 
from
dailyactivenumber
where
servicecategory='Internet'
group by 
servicetype, period, contractstate
; 


select servicetype, period, count(contractcode) as contractcount 
from
dailyactivenumber
where
servicecategory='Internet'
group by 
servicetype, period
; 



